$('.btn-scroll[href*="#"]').not('[href="#"]').not('[href="#0"]').click(function(t){if(location.pathname.replace(/^\//,"")==this.pathname.replace(/^\//,"")&&location.hostname==this.hostname){var a=$(this.hash);(a=a.length?a:$("[name="+this.hash.slice(1)+"]")).length&&(t.preventDefault(),$("html, body").animate({scrollTop:a.offset().top},500))}}),$(function(){return $(".carousel.lazy").on("slide.bs.carousel",function(t){var a;(a=$(t.relatedTarget).find("img[data-src]")).attr("src",a.data("src")),a.removeAttr("data-src")})});